import React from 'react';

const App = () => {
    return (
        <div className="main_div">
            <div className="center_div">
                <h1>Todo List</h1>
                <input type='text' placeholder='Add a todo' />
                <button>+</button>
                <ol>
                    <li>Hey</li>
                </ol>
             </div>
        </div>
    );
}

export default App;
